Atardecer 
Anochecer continuo.
Y empieza, pasa, merienda a la tardecita
Y en la noche se recoge para refugiarse en el corazón que descansando de los latidos del día te sueña en el descanso.
Y así los días,
Sin un hasta para no ponerle límites,
Con esperanza para darle vida.
La tuya y la mía, vida. 

Suzu 

